/* Comparison */
const compCont = document.querySelector(".comparison-content");
// Array with logo names
const logoArray = [
    "USER_LOGO",
    adobeLogo,
    amazonLogo,
    bmwLogo,
    dunkinDonutsLogo,
    logitechLogo,
    microsoftLogo,
    nikeLogo,
    pepsiLogo,
    sonyLogo,
    starbucksLogo,
    xboxLogo
];
// Generate a random logo
function insertRandomLogo() {
    // Create a copy of the logoArray
    // so the items are not removed from the original array causing problems
    const copiedLogoArray = logoArray.slice();
    for (let icon = 0; icon < logoArray.length; icon++) {
        // Generate a random index
        const randIndex = Math.floor(Math.random() * copiedLogoArray.length);
        const thisLogo = copiedLogoArray[randIndex];
        // Create the logo HTML element
        const newLogoDiv = document.createElement("div");
        newLogoDiv.classList.add("cc-logo");
        // Check if it's a pre-defined logo or the uploaded one
        if (thisLogo !== "USER_LOGO") {
            const newLogo = document.createElement("div");
            newLogo.innerHTML = thisLogo;
            newLogoDiv.appendChild(newLogo);
        }
        else {
            newLogoDiv.classList.add("insert-logo");
        }
        // Append the logo
        compCont.appendChild(newLogoDiv);
        // Remove the item from the array, so it won't repeat
        copiedLogoArray.splice(randIndex, 1);
    }
}
insertRandomLogo();
